// refactor function to return arrays of bivakzone objects instead of strings
function getFeature(i, bivakzone) {
    if (bivakzone.properties[i] === undefined) {
        return ("")
    } else {
        return (<li>{i + ':' + bivakzone.properties[i]}</li>)
    }
}
